import {connect} from "react-redux";
import Adverts from "./Adverts";
import {
  getAdverts,
  getAppartaments, getAppliance,
  getCars, getFurniture,
  getHousehold,
  getHouses,
  getImmovables,
  getMotocycles, getNewAds,
  getTransport
} from "../redux/AdvertsReducer";

let mapStateToProps = (state) => {
  return {
    /*immovables: state.viewAds.immovables,
    transport: state.viewAds.transport,
    household: state.viewAds.household,

    houses: state.viewAds.houses,
    appartaments: state.viewAds.appartaments,

    cars: state.viewAds.cars,
    motocycles: state.viewAds.motocycles,

    appliances: state.viewAds.appliances,
    furniture: state.viewAds.furniture,

    newAds: state.viewAds.newAds,*/

    adverts: state.viewAds.adverts,

  }
}

const AdvertsContainer = connect(mapStateToProps, {
  getImmovables, getTransport, getHousehold, getHouses, getAppartaments,
  getCars, getMotocycles, getAppliance, getFurniture, getNewAds, getAdverts
})(Adverts);

export default AdvertsContainer;
